import react,{ Component } from "react";
import movie from './data/run_results.json';


class Movies extends Component{
    render(){
        return(
            <div>
                {movie.map(movieList,index =>{
                    return <h1>{movieList.name}</h1>
                })}
            </div>
        )
    }
}
export default Movies
